import React from "react";
import Header from "./Header"  
import Footer from "./Footer" 
import notes from "../Note"
function App(){
    return <div>
        <Header/>
        {
            notes.map(notesItem=>(
                <Note
                    key={notesItem.id}
                    title={notesItem.title}
                    content={notesItem.content}
                    />
            ))
        }

        <Footer/>
        
    </div>
} 

export default App;
